import React, { useEffect, useState } from "react";

const Api = () => {
  const [user, setUser] = useState([]);

  useEffect(() => {
    fetch("https://dummyjson.com/products/1").then((data) => {
      data.json().then((result) => {
        console.log("result", result);
        setUser(result.data);
      });
    });
  }, []);

  return (
    <>
      <table>
        <tr>
          <th>id</th>
          <th>Title</th>
          <th>description</th>
          <th>price</th>
          <th>rating</th>
          <th>stock</th>
        </tr>
      </table>
    </>
  );
};

export default Api;
